import React from 'react';
import {AuthHeader, ContentLayout, FormReference, FormSubmit} from "@shared/ui";
import {LoginForm, SocialAuth, ValidationForm} from "@widgets";
import {loginValidator} from "@shared/lib";
import {ROUTER_URL} from "@shared/config";

export const LoginPage = () => {
    return (
        <ContentLayout center>
            <AuthHeader>
                Добро пожаловать!
                <br/>
                <span>Авторизуйтесь для доступа к сервису</span>
            </AuthHeader>

            {/*<LoginForm />*/}
            <ValidationForm validator={loginValidator} center>
                <FormReference to={ROUTER_URL.RECOVERY}>Забыли пароль?</FormReference>
                <FormSubmit>Войти</FormSubmit>
                <FormReference to={ROUTER_URL.REGISTRATION}>Перейти к регистрации</FormReference>
            </ValidationForm>

            <SocialAuth />
        </ContentLayout>
    );
};
